import React from 'react';
import "../../App.css";
import Header from '../header/Header';
import Footer from '../footer/Footer';
import ScrollUp from '../scrollup/ScrollUp';
import "./projectpage.css"

import ReactMarkdown from 'react-markdown'
import remarkMath from 'remark-math'
import rehypeKatex from 'rehype-katex'

import 'katex/dist/katex.min.css' // `rehype-katex` does not import the CSS for you


const BirdChickFeeding = () => {
    return (
      <>
      <Header />
    
        <div className='container'>

            <section className="projectpage__section">
                    <h2 className="projectpage__title">Modelling The Number Of Feeds For Bird Chicks</h2>
                    <span className="projectpage__subtitle">This is the subtitle of the article.</span>
                    <span className="projectpage__stats">

                    <i class="uil uil-calender projectpage__icon"></i>
                    <p>Published on January 17, 2022</p>
                    <p class="projectpage__bullet">•</p>

                    <i class="uil uil-clock projectpage__icon"></i>
                    <p>14 minutes</p>
                    <p class="projectpage__bullet">•</p>

                    <i class="uil uil-book-open projectpage__icon"></i>
                    <p>2925 words</p>

                    </span>

                    <div className='headline__image bird__image'></div>

                    <p className='project__textblock'><b>Context:</b> As part of my Statistical Fundamentals module I wrote a report on some Bird Chick Feeding Data (fictional), analysing which factors affect the amount of food chicks from this species receive. I was disappointment in my work for this project because I felt I could have done better given more time. <mark className='highlight'><b>I was awarded a letter grade of A for this project which translated to 75%</b></mark> (presumably to mitigate against grade inflation). My work in this project, alongside my coursework grades, was a contributing factor in the lecturers decision to approach me about a PhD opportunity with him. All analysis in this project was conducted using R.</p>

                    <ReactMarkdown 
className='ReactMarkdown'
children={`## Introduction`}
remarkPlugins={[remarkMath]}
rehypePlugins={[rehypeKatex]}
/>

                    <ReactMarkdown 
                      className='ReactMarkdown'
                      children={`The number of individual feeds of chicks is important in their development into adult birds. This study aims to model the number of individual feeds observed for each chick from a particular species of bird, over a certain time period, to determine which factors affect the amount of food chicks from this species receive. Alongside the response variable, $Y_i$ - the integer number of feeds observed for a particular chick, the data used in this study contains 7 covariates. These include: $\\mathrm{O}_{\\mathrm{i}}$, the time (in decimal hours) over which that chick was observed; $S_i$, sex of the chick; $A_i$, most common age of the non-breeding group members of the unit - either Adult or Yearling; $\\mathrm{R}_{\\mathrm{i}}$, pedigree-based relatedness of the brood ( $0.5=$ first-order, $0.25=$ second order, $0=$ more distant); $\\mathrm{Z}_{\\mathrm{i}}$, age of the chick in days; $B_i$, integer number size of the brood (the number of chicks in the clutch to which the individual chick belongs); $\\mathrm{U}_{\\mathrm{i}}$, the number of yearlings and adults in a breeding unit. The Methods, Results and ensuing Discussion have been packaged into one intertwined section to demonstrate the model building process in chronological order. This section is broken down into further subsections, each relating to a stage of the model building process.`}
                      remarkPlugins={[remarkMath]}
                      rehypePlugins={[rehypeKatex]}
                    />

            </section>

        </div>

      <Footer />
      <ScrollUp />
      </>
    );
  };


export default BirdChickFeeding
